lens_2.query:
opp = load "${App.Datasets.ForecastSnapshotDemo.FullyQualifiedName}";
opp = filter opp by 'OwnerName' in ["Mary Eng"];
opp = filter opp by {{cell(LatestSnapshot_1.result, 0, "SnapshotTextDate").asEquality("SnapshotTextDate")}};
opp = filter opp by date('PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day') in [.."current day"];
opp = group opp by ('OwnerName', 'SmallPhotoUrl', 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'ForecastCategory');
opp = foreach opp generate 'OwnerName', 'SmallPhotoUrl', 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'ForecastCategory', avg('ForecastAmount') as 'ForecastAmount', avg('ForecastMultiplier') as 'ForecastMultiplier', avg('AttainmentMultiplier') as 'AttainmentMultiplier';
quota = load "${App.Datasets.ForecastingQuotaDemo.FullyQualifiedName}";
quota = filter quota by 'OwnerName' in ["Mary Eng"];
k = group opp by all;
k = foreach k generate "1970" as 'Date_Year', "01" as 'Date_Month', "01" as 'Date_Day';
k = group k by ('Date_Year', 'Date_Month', 'Date_Day');
k = foreach k generate 'Date_Year', 'Date_Month', 'Date_Day', count() as 'sum';
k = fill k by (dateCols=('Date_Year','Date_Month','Date_Day', "Y-M-D"));
k = timeseries k generate 'sum' as 'cnt' with (length=25000,  dateCols=('Date_Year','Date_Month','Date_Day', "Y-M-D"));
k = filter k by date('Date_Year','Date_Month', 'Date_Day') in ["current year".."current year"];
k = filter k by date('Date_Year','Date_Month', 'Date_Day') in [.."current day"];
k = group k by all;
k1 = foreach k generate first('Date_Year') as 'PeriodStartDate_Year', first('Date_Month') as 'PeriodStartDate_Month', first('Date_Day') as 'PeriodStartDate_Day', " - " as 'OwnerName';
k2 = foreach k generate last('Date_Year') as 'PeriodStartDate_Year', last('Date_Month') as 'PeriodStartDate_Month', last('Date_Day') as 'PeriodStartDate_Day', " - " as 'OwnerName';
k3 = union k1,k2;
a = filter opp by 'ForecastCategory' in ["Closed"];
a = group a by ('PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'OwnerName');
a = foreach a generate 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'OwnerName', sum(a.'ForecastAmount') as 'A';
c = union a,k3;
c = foreach c generate 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day','OwnerName', 'A';
c = fill c by (dateCols=('PeriodStartDate_Year','PeriodStartDate_Month','PeriodStartDate_Day', "Y-M-D"), partition='OwnerName');
c = filter c by 'OwnerName' not in [" - "];
c = group c by ('PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'OwnerName');
c = foreach c generate c.'PeriodStartDate_Year' + "~~~" + c.'PeriodStartDate_Month' + "~~~" + c.'PeriodStartDate_Day' as 'PeriodStartDate_Year~~~PeriodStartDate_Month~~~PeriodStartDate_Day', 'OwnerName', first(A) as 'A', 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day';
c = group c by ('PeriodStartDate_Year~~~PeriodStartDate_Month~~~PeriodStartDate_Day', 'OwnerName');
c = foreach c generate 'PeriodStartDate_Year~~~PeriodStartDate_Month~~~PeriodStartDate_Day', 'OwnerName', first(A) as 'A', first('PeriodStartDate_Year') as 'PeriodStartDate_Year', first('PeriodStartDate_Month') as 'PeriodStartDate_Month', first('PeriodStartDate_Day') as 'PeriodStartDate_Day', sum(sum(A)) over ([..0] partition by 'OwnerName' order by ('PeriodStartDate_Year~~~PeriodStartDate_Month~~~PeriodStartDate_Day')) as 'sum_Amount';
c = timeseries c generate 'sum_Amount' as 'estimate' with (partition='OwnerName',length=100, predictionInterval=95, ignoreLast=false, dateCols=('PeriodStartDate_Year','PeriodStartDate_Month','PeriodStartDate_Day', "Y-M-D"));
c = foreach c generate 'PeriodStartDate_Year', 'PeriodStartDate_Month', 'PeriodStartDate_Day', 'PeriodStartDate_Year' + "~~~" + 'PeriodStartDate_Month' + "~~~" + 'PeriodStartDate_Day' as 'PeriodStartDate_Year~~~PeriodStartDate_Month~~~PeriodStartDate_Day', 'OwnerName', A, sum_Amount, estimate, estimate_high_95, estimate_low_95;
c = filter c by date('PeriodStartDate_Year','PeriodStartDate_Month', 'PeriodStartDate_Day') in ["current year".."current year"];
c = group c by 'OwnerName';
c = foreach c generate 'OwnerName', last('estimate') as 'sum_prediction';
actual = filter opp by 'ForecastCategory' == "Closed";
q = cogroup actual by 'OwnerName' full, quota by 'OwnerName' full, c by 'OwnerName';
q = foreach q generate coalesce(actual.'OwnerName', first(quota.'OwnerName'), c.'OwnerName') as 'OwnerName', coalesce(first(actual.'OwnerName'), first(quota.'OwnerName')) as 'User_Name', first(actual.'SmallPhotoUrl') as 'Photo', sum(actual.'ForecastAmount') as 'sum_Amount', sum(quota.'QuotaAmount') as 'sum_QuotaAmount', round(first(actual.'AttainmentMultiplier') * sum(actual.'ForecastAmount')/sum(quota.'QuotaAmount') * 100) as 'sum_quota_attainment', round(sum(c.'sum_prediction') * first(actual.'ForecastMultiplier')/sum(quota.'QuotaAmount') * 100) as 'sum_user_prediction', round(sum(c.'sum_prediction') * first(actual.'ForecastMultiplier')) as 'sum_prediction_amount';
q = order q by 'sum_user_prediction' desc nulls last;
